import React from 'react'
import DateTime from '../date-time/DateTime'

function InterNationalCovidUpdate({headingTextData}) {
    const headingText = "Welcome to Covid-19 Live Updates";
    return (
        <div>
            <DateTime headingTextData={headingTextData} />
        </div>
    )
}

export default InterNationalCovidUpdate;
